const Day = ( {day, onClick}) => {

    const className = `day ${day.value === 'padding' ? 'padding' : ''}`

    return (
        <div className="day">
            {day.value === 'padding' ? '' : day.value}
            { day.event && <div className='event'>{day.event.title}</div>}
        </div>
    )
}

